  false,\n\t\"url\": null,\n\t\"notes\": \"The following narrative report summarizes
  the results of the refuge's annual wetland management program for 1995 and describes
  plans for 1996, The year 1995 marked the refuge's continued efforts in managing
  its entire wetland complex utilizing an integrated wetland management approach in
  its water level management program.  The focus of wetland management has changed
  from a single species approach to a more comprehensive approach as a result of the
  current emphasis on biodiversity and landscape ecology.\",\n\t\"license_title\":
